import React from 'react';
import './myPropertyCard.styles.css';

const MyPropertyCard = ({ address }) => {
  return (
    <div>
      <h1>{`${address.street}, ${address.city}, ${address.state}`}</h1>
    </div>
  );
};

export default MyPropertyCard;
